import React from "react";

function EditAvatarPopup() {
  return (
    <PopupWithForm
      name="edit-avatar"
      title="Change Profile Picture"
      buttonText="Save"
      isOpen={isEditAvatarPopupOpen}
      onClose={closeAllPopups}
      children={editAvatarChildren()}
    />
  );
}

export default EditAvatarPopup;
